            <h2 className="presents-subtitle">Web Developer FULL STACK<Pointer/></h2>
            <div className="presents-links">
              <a className="presents-hireme" href="contacts">HIRE ME</a>
            </div>
          </div>
          <img class="flag-logo" src={ Logo } alt="Logo"/>
        </div>
      </div>
    )
  }
}
